compressionLevel: mixed

enableGlobalCache: false

nodeLinker: pnp

packageExtensions:
  "@elastic/ecs-winston-format@*":
    dependencies:
      winston: ^3.8.2
  "@remix-run/dev@*":
    dependencies:
      dom7: "*"
      ssr-window: "*"
      swiper: ^8.4.5
  swiper@*:
    dependencies:
      react: "*"

yarnPath: .yarn/releases/yarn-4.6.0.cjs
